    return (
            <div className="modal-back">
                 <Modal
                    animationType="fade"
                    transparent={true}
                    visible={modalVisible}
                >
                    <div className="settings-modal">
                        <p onClick={() => setModalVisible(false)}>x</p>
                        yyy
                    </div>
                </Modal>
            </div>
           
    );
}
